import React from "react"
import CountUp from "react-countup"
const Navbar = (props) =>{
    let count_AC=0,count_WA=0,count_TLE=0,count_CE=0,count_RTE=0;
    for(let i=0;i<props.res.length;i++){
      if(props.res[i].verdict==="OK"){
        count_AC+=1;
      }
      else if(props.res[i].verdict==="WRONG_ANSWER"){
          count_WA+=1;
      }
      else if(props.res[i].verdict==="TIME_LIMIT_EXCEEDED"){
          count_TLE+=1;
      }
      else if(props.res[i].verdict==="COMPILATION_ERROR"){
          count_CE+=1;
      }
      else if(props.res[i].verdict==="RUNTIME_ERROR"){
        count_RTE+=1;
    }
    }

    
    
    return(
        <div>
            {/* <h1>Accepted: <CountUp
                    start = {0}
                    end={count_AC}
                    duration = {1.3}
                    separator = ','

                    /></h1>
            <h1>Wrong Answer: <CountUp
                    start = {0}
                    end={count_WA}
                    duration = {1.3}
                    separator = ','

                    /></h1>
            <h1>Time Limit Exceeded: <CountUp
                    start = {0}
                    end={count_TLE}
                    duration = {1.3}
                    separator = ','

                    /></h1>
            <h1>Compilation Error: <CountUp
                    start = {0}
                    end={count_CE}
                    duration = {1.3}
                    separator = ','

                    /></h1>
            <h1>Runtime Error : <CountUp
                    start = {0}
                    end={count_RTE}
                    duration = {1.3}
                    separator = ','

                    /></h1>
            <h1>Memory Limit Exceeded: <CountUp
                    start = {0}
                    end={count_CE}
                    duration = {1.3}
                    separator = ','

                    /></h1> */}

            

            
        </div>
    )



}

export default Navbar
